The first thing that we need is to write the code for our container contract. This contract's role is to contain the web application code itself, allowing it to be distributed over Locutus. The new command has created the source ready to be modified for us, in your favorite editor open the following file: $ ./container/src/lib.rs In this case, and for simplicity's sake, the contract won't be performing any functions, but in a realistic scenario, this contract would include some basic security functionality like verifying that whoever is trying to update the contract has the required credentials. To make our contract unique so it doesn't collide with an existing contract, we can generate a random signature that will be embedded with the contract. For example in the lib.rs file we will write the following: use locutus_stdlib::prelude::*; pub const RANDOM_SIGNATURE: &[u8] = &[6, 8, 2, 5, 6, 9, 9, 10]; struct Contract; #[contract]
impl ContractInterface for Contract { fn validate_state( _parameters: Parameters<'static>, _state: State<'static>, _related: RelatedContracts<'static>, ) -> Result<ValidateResult, ContractError> { unimplemented!() } fn validate_delta( _parameters: Parameters<'static>, _delta: StateDelta<'static>, ) -> Result<bool, ContractError> { unimplemented!() } fn update_state( _parameters: Parameters<'static>, _state: State<'static>, _data: Vec<UpdateData<'static>>, ) -> Result<UpdateModification<'static>, ContractError> { unimplemented!() } fn summarize_state( _parameters: Parameters<'static>, _state: State<'static>, ) -> Result<StateSummary<'static>, ContractError> { unimplemented!() } fn get_state_delta( _parameters: Parameters<'static>, _state: State<'static>, _summary: StateSummary<'static>, ) -> Result<StateDelta<'static>, ContractError> { unimplemented!() }
} That's a lot of information, let's unpack it: use locutus_stdlib::prelude::*; Here we are importing the necessary types and traits to write a Locutus contract successfully using Rust. pub const RANDOM_SIGNATURE: &[u8] = &[6, 8, 2, 5, 6, 9, 9, 10]; This will make our contract unique, notice the pub qualifier so the compiler doesn't remove this constant because is unused and is included in the output of the compiler. struct Contract; #[contract]
impl ContractInterface for Contract { ...
} Here we create a new type, Contract for which we will be implementing the ContractInterface trait. To know more details about the functionality of a contract, delve into the details of the contract interface . Notice the #[contract] macro call, this will generate the necessary code for the WASM runtime to interact with your contract ergonomically and safely. Trying to use this macro more than once in the same module will result in a compiler error, and only the code generated at the top-level module will be used by the runtime. As a rule of thumb, one contract will require implementing the `ContractInterface`` exactly once.

