Now we have a working example of a contract, but our contract is an empty shell, which does not do anything yet. To change this, we will start developing our web application. To do that, we can go and modify the code of the contract state, which in this case is the web application. Locutus offers a standard library (stdlib) that can be used with Typescript/JavaScript to facilitate the development of web applications and interfacing with your local node, so we will make our package.json contains the dependency: { "dependencies": { "@locutus/locutus-stdlib": "0.0.2" }
} Open the file src/index.ts in a code editor and you can start developing the web application. An important thing to notice is that our application will need to interface with our local node, the entry point for our machine to communicate with other nodes in the network. The stdlib offers a series of facilities in which you will be able to communicate with the network ergonomically. Here is an example of how you could write your application to interact with the node: import { LocutusWsApi } from "@locutus/locutus-stdlib/webSocketInterface"; const handler = { onPut: (_response: PutResponse) => {}, onGet: (_response: GetResponse) => {}, onUpdate: (_up: UpdateResponse) => {}, onUpdateNotification: (_notif: UpdateNotification) => {}, onErr: (err: HostError) => {}, onOpen: () => {},
}; const API_URL = new URL(`ws://${location.host}/contract/command/`);
const locutusApi = new LocutusWsApi(API_URL, handler); const CONTRACT = "DCBi7HNZC3QUZRiZLFZDiEduv5KHgZfgBk8WwTiheGq1"; async function loadState() { let getRequest = { key: Key.fromSpec(CONTRACT), fetch_contract: false, }; await locutusApi.get(getRequest);
} Let's unpack this code: const handler = { onPut: (_response: PutResponse) => {}, onGet: (_response: GetResponse) => {}, onUpdate: (_up: UpdateResponse) => {}, onUpdateNotification: (_notif: UpdateNotification) => {}, onErr: (err: HostError) => {}, onOpen: () => {},
}; const API_URL = new URL(`ws://${location.host}/contract/command/`);
const locutusApi = new LocutusWsApi(API_URL, handler); This type provides a convenient interface to the WebSocket API. It receives an object which handles the different responses from the node via callbacks. Here you would be able to interact with DOM objects or other parts of your code. const CONTRACT = "DCBi7HNZC3QUZRiZLFZDiEduv5KHgZfgBk8WwTiheGq1"; async function loadState() { let getRequest = { key: Key.fromSpec(CONTRACT), fetch_contract: false, }; await locutusApi.get(getRequest);
} Here we use the API wrapper to make a get request (which requires a key and specifies if we require fetching the contract code or not) to get the state for a contract with the given address. The response from the node will be directed to the onGet callback. You can use any other methods available in the API to interact with the node.

