In the creating a new contract section we described the contract interface, but we were using it to write a simple container contract that won't be doing anything in practice, just carrying around the front end of your application. The core logic of the application, and a back end where we will be storing all the information, requires another contract. So we will create a new contract in a different directory for it: $ cd ../backend
$ ldt new contract This will create a regular contract, and we will need to implement the interface on a type that will handle our contract code. For example: use locutus_stdlib::prelude::*; pub const RANDOM_SIGNATURE: &[u8] = &[6, 8, 2, 5, 6, 9, 9, 10]; struct Contract; struct Posts(...) impl Posts { fn add_post(&mut self, post: Post) { ... }
} struct Post(...) #[contract]
impl ContractInterface for Contract { fn update_state( _parameters: Parameters<'static>, state: State<'static>, data: Vec<UpdateData<'static>>, ) -> Result<UpdateModification<'static>, ContractError> { let mut posts: Posts = serde_json::from_slice(&state).map_err(|_| ContractError::InvalidState)?; if let Some(UpdateData::Delta(delta)) = data.pop() { let new_post: Posts = serde_json::from_slice(&delta).map_err(|_| ContractError::InvalidState); posts.add_post(new_post)?; } else { Err(ContractError::InvalidUpdate) } Ok(UpdateModification::valid(posts.into())) } ...
} In this simple example, we convert a new incoming delta to a post and the state to a list of posts we maintain, and we append the post to the list of posts. After that, we convert back the posts list to an state and return that. If we subscribe to the contract changes or our web app, we will receive a notification with the updates after they are successful, and we will be able to render them in our browser. We can do that, for example, using the API: function getUpdateNotification(notification: UpdateNotification) { let decoder = new TextDecoder("utf8"); let updatesBox = DOCUMENT.getElementById("updates") as HTMLPreElement; let newUpdate = decoder.decode(Uint8Array.from(notification.update)); let newUpdateJson = JSON.parse(newUpdate); updatesBox.textContent = updatesBox.textContent + newUpdateJson;
}

